CREATE TABLE dze_opis(
   Działka_ewidencyjna VARCHAR(21) NOT NULL PRIMARY KEY
  ,Nazwa               VARCHAR(10) NOT NULL
  ,AM                  VARCHAR(10)
  ,Obreb_ew            VARCHAR(13) NOT NULL
  ,Nazwa_obrebu        VARCHAR(8) NOT NULL
  ,Jednostka_rej       VARCHAR(28) NOT NULL
  ,Data_wladania       TIMESTAMP
  ,Rejon_stat          VARCHAR(10)
  ,Wartosc             MONEY
  ,Data_wyceny         DATE 
  ,Dokladnosc          VARCHAR NOT NULL
  ,Nr_rejestru_zab     VARCHAR(30)
  ,Odchylka            VARCHAR(16) NOT NULL
  ,Pow_ew              INTEGER  NOT NULL
  ,Pow_geod            INTEGER 
  ,SWDETag             VARCHAR(7) NOT NULL
  ,Data_weryfikacji    TIMESTAMP  NOT NULL
  ,Data_utworzenia     TIMESTAMP  NOT NULL
  ,Archiwalny          BOOLEAN  NOT NULL
);
